import React from 'react';

function App() {
  const headerStyle = {
    backgroundColor: '#f0f0f0',
    padding: '20px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
  };

  const titleStyle = {
    margin: 0,
    fontSize: '24px',
  };

  const logoStyle = {
    height: '60px',
    marginRight: '20px',
  };

  const adminStyle = {
    padding: '10px 20px',
    backgroundColor: '#007BFF',
    color: 'white',
    border: 'none',
    cursor: 'pointer',
    borderRadius: '4px',
  };

  const formWrapperStyle = {
    display: 'flex',
    justifyContent: 'center',
    padding: '40px 20px',
    backgroundColor: '#f9f9f9',
  };

  const formContainerStyle = {
    width: '100%',
    maxWidth: '600px',
    padding: '30px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    backgroundColor: '#fff',
    boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
    fontFamily: 'Arial, sans-serif',
  };

  const formRowStyle = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '15px',
  };

  const labelStyle = {
    width: '150px',
    fontWeight: 'bold',
  };

  const inputStyle = {
    flex: 1,
    padding: '8px',
    border: '1px solid #ccc',
    borderRadius: '4px',
  };

  const submitStyle = {
    padding: '10px 20px',
    backgroundColor: 'green',
    color: 'white',
    border: 'none',
    cursor: 'pointer',
    borderRadius: '4px',
    marginTop: '20px',
  };

  return (
    <div>
      {/* Header */}
      <div style={headerStyle}>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img
            src="https://akasainstitute.com/wp-content/uploads/2025/05/WhatsApp-Image-2025-04-25-at-9.31.43-PM.jpeg"
            alt="Logo"
            style={logoStyle}
          />
          <h1 style={titleStyle}>Akasa Institute</h1>
        </div>
    
      </div>

      {/* Form Wrapper */}
      <div style={formWrapperStyle}>
        <form style={formContainerStyle}>
          <div style={formRowStyle}>
            <label style={labelStyle}>Register No:</label>
            <input type="text" name="regno" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Date:</label>
            <input type="date" name="date" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Phone:</label>
            <input type="tel" name="phone" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Email:</label>
            <input type="email" name="email" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Payment Purpose:</label>
            <input type="text" name="purpose" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Amount:</label>
            <input type="number" name="amount" style={inputStyle} />
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}>Payment Mode:</label>
            <select name="mode" style={inputStyle}>
              <option value="upi">UPI</option>
              <option value="cash">Cash</option>
              <option value="bank">Bank Transaction</option>
            </select>
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}></label>
            <label>
              <input type="checkbox" name="agree" /> I confirm the information is correct.
            </label>
          </div>

          <div style={formRowStyle}>
            <label style={labelStyle}></label>
            <button type="submit" style={submitStyle}>Submit</button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default App;
